import styled from "styled-components";
import Navbar from "../components/Navbar";
import Publication from "../components/Publication";
import Footer from "../components/Footer";
import { Add, Remove } from "@mui/icons-material";

const Container = styled.div``;

const Wrapper = styled.div`
  padding: 20px;
`;

const Title = styled.h1`
  font-weight: 300;
  text-align: center;
`;

const Top = styled.div`
  display: flex;
  align-items: center;
  justify-content: space-between;
  padding: 20px;
`;

const TopButton = styled.button`
  padding: 10px;
  font-weight: 600;
  cursor: pointer;
  border: ${(props) => props.type === "filled" && "none"};
  background-color: ${(props) =>
    props.type === "filled" ? "black" : "transparent"};
  color: ${(props) => props.type === "filled" && "white"};
`;

const TopTexts = styled.div``;

const TopText = styled.span`
  text-decoration: underline;
  cursor: pointer;
  margin: 0px 10px;
`;

const Bottom = styled.div`
  display: flex;
  justify-content: center;
`;

const Details = styled.div`
  flex: 3;
`;

const Product = styled.div`
  display: flex;
  justify-content: space-between;
`;

const ProductInfo = styled.div`
  display: flex;
  flex: 2;
`;

const Image = styled.img`
  width: 200px;
`;

const Info = styled.div`
  padding: 20px;
  display: flex;
  flex-direction: column;
  justify-content: space-around;
`;

const ProductName = styled.div``;

const ProductId = styled.span``;

const ProductColor = styled.div`
  width: 20px;
  height: 20px;
  border-radius: 50%;
  background-color: ${(props) => props.color};
`;

const ProductSize = styled.span``;

const PriceInfo = styled.span`
  flex: 1;
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
`;

const ProductAmountContainer = styled.span`
  display: flex;
  align-items: center;
  margin: 20px 20px;
`;

const ProductAmount = styled.span`
  font-size: 25px;
  margin: 5px;
`;

const ProductPrice = styled.span`
  font-size: 30px;
  font-weight: 202;
`;

const Hr = styled.hr`
  background-color: #eee;
  border: none;
  height: 1px;
`;

const Summary = styled.div`
  flex: 1;
`;

const ShoppingCart = () => {
  return (
    <Container>
      <Navbar />
      <Publication />
      <Wrapper>
        <Title>Shopping Cart</Title>
        <Top>
          <TopButton>CONTINUE SHOPPING</TopButton>
          <TopTexts>
            <TopText>YOUR BAG(2)</TopText>
            <TopText>WISHLIST(0)</TopText>
          </TopTexts>
          <TopButton type="filled">CHECKOUT NOW</TopButton>
        </Top>
        <Bottom>
          <Details>
            <Product>
              <ProductInfo>
                <Image src="./blueSingle.png" />
                <Info>
                  <ProductName>
                    <b>Product:</b> ZJM SHORT SLEEVED AND COTTON BOTTOMS
                  </ProductName>
                  <ProductId>
                    <b>ID:</b> 1017516333
                  </ProductId>
                  <ProductColor color="#d2eaf3" />
                  <ProductSize>
                    <b>SIZE:</b> S
                  </ProductSize>
                </Info>
              </ProductInfo>
              <PriceInfo>
                <ProductAmountContainer>
                  <Add />
                  <ProductAmount>2</ProductAmount>
                  <Remove />
                </ProductAmountContainer>
                <ProductPrice>$ 32.99</ProductPrice>
              </PriceInfo>
            </Product>
            <Hr />
            <Product>
              <ProductInfo>
                <Image src="./purpleSingle.png" />
                <Info>
                  <ProductName>
                    <b>Product:</b> ZJM SHORT SLEEVED AND COTTON BOTTOMS
                  </ProductName>
                  <ProductId>
                    <b>ID:</b> 1017516333
                  </ProductId>
                  <ProductColor color="#dfc8f2" />
                  <ProductSize>
                    <b>SIZE:</b> S
                  </ProductSize>
                </Info>
              </ProductInfo>
              <PriceInfo>
                <ProductAmountContainer>
                  <Add />
                  <ProductAmount>2</ProductAmount>
                  <Remove />
                </ProductAmountContainer>
                <ProductPrice>$ 32.99</ProductPrice>
              </PriceInfo>
            </Product>
          </Details>
          <Summary>Summary</Summary>
        </Bottom>
      </Wrapper>
      <Footer />
    </Container>
  );
};

export default ShoppingCart;
